import { Container, Dropdown, DropdownItem, DropdownMenu, DropdownToggle, Table, Form, FormGroup, Input, Row, Col} from "reactstrap";
import {Link} from 'react-router-dom';
import Pagination from "react-js-pagination";
import companyListAPI from "../../api/companyListAPI";
import SidebarAdmin from "../SidebarAdmin/SidebarAdmin";
import '../../css/CompanyList.css';
import { useEffect, useState } from "react";


function CompanyList(){
    const [filter, setFilter] = useState(false);
    const toggle = () => setFilter(prevState => ! prevState);
    const [search, setSearch] = useState('');
    const [postList, setPostList] = useState([]);
    const [activePage, setActivePage] = useState(1);

    function pageChange(pageNumber){
        console.log(`active page is ${pageNumber}`);
        setActivePage(pageNumber);
    }

    useEffect(()=>{
        async function fetchPostList(){
            const response = await companyListAPI.getAll();
            setPostList(response.data);
        }
        fetchPostList();
        const result = postList.filter(company =>
            company.name.toLowerCase().includes(search.toLowerCase()));
           setPostList(result);
    },[search])

    const handleChange = event =>{
        setSearch(event.target.value);
    }
    function handlePageChange(newPage){
        console.log(newPage);
    }
    console.log(search);

    return(
        <div>
            <SidebarAdmin/>
            <div className="main-panel">
            <Container fluid={true}>
                <div className="search_form">
                    <Form>
                        <FormGroup>
                            <Row>
                                <Col xs={10}>
                                    <Input type="search" className="form-control rounded" value={search} onChange={handleChange} placeholder="Search by name company"/>
                                </Col>
                                <Col xs={2}>
                                    <Dropdown isOpen={filter}toggle={toggle}>
                                    <DropdownToggle caret>
                                        Filter
                                    </DropdownToggle>
                                    <DropdownMenu>
                                        <DropdownItem>Active</DropdownItem>
                                        <DropdownItem>Deactive</DropdownItem>
                                    </DropdownMenu>
                                    </Dropdown>
                                </Col>
                            </Row>
                        </FormGroup>

                    </Form>
                </div>
                <Table className="table_css">
                    <thead>
                        <tr>
                            <th>STT</th>
                            <th>Company Name</th>
                            <th>Aplicant Name</th>
                            <th>Date Created</th>
                            <th>Status</th>
                            <th>Phone Number</th>
                            <th>Edits/Details</th>
                        </tr>
                    </thead>
                    <tbody>
                        {postList.map(data => (
                            <tr key={data.id}>
                                    <th>{data.id}</th>
                                    <td>{data.name}</td>
                                    <td>{data.admin}</td>
                                    <td>{data.dateCreate}</td>
                                    <td>{data.status===1? <p style={{color:'green'}}>Active</p> : <p style={{color:'red'}}>Deactive</p>}</td>
                                    <td>{data.phone}</td>
                                    <td>
                                        <Link to="/edit-company">Edit/Detail</Link>
                                    </td>
                            </tr>))}  
                    </tbody>    
            </Table>
            <Pagination
                activePage={activePage}
                itemsCountPerPage={10}
                totalItemsCount={450}
                pageRangeDisplayed={5}
                onChange={pageChange}
            />
            </Container>
            </div>
        </div>
    );
}
export default CompanyList;
